KeyAuthority.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract KeyAuthority {
    address public owner;

    mapping(address => bool) public authorities;
    mapping(bytes32 => uint256) public approvalCount;
    mapping(bytes32 => mapping(address => bool)) public approvedBy;

    uint256 public constant THRESHOLD = 4;

    constructor(address[] memory _authorities) {
        owner = msg.sender;
        for (uint i = 0; i < _authorities.length; i++) {
            authorities[_authorities[i]] = true;
        }
    }

    modifier onlyAuthority() {
        require(authorities[msg.sender], "Not authority");
        _;
    }

    function approveKey(bytes32 keyId) external onlyAuthority {
        require(!approvedBy[keyId][msg.sender], "Already approved");

        approvedBy[keyId][msg.sender] = true;
        approvalCount[keyId]++;
    }

    function isApproved(bytes32 keyId) external view returns (bool) {
        return approvalCount[keyId] >= THRESHOLD;
    }
}

